def run(value_list):
    """
    Calculates the increase/decrease in Statutory Audit, Certification, Audit of Individual and Consolidated Financial Statements from 2018 to 2019.

    Args:
        value_list: A list of dictionaries containing financial data.

    Returns:
        A tuple (number, scale).
    """

    audit_2018 = None
    audit_2019 = None

    for item in value_list:
        if item['category'] == 'Statutory Audit, Certification, Audit of Individual and Consolidated Financial Statements' and item['header2'] == '2018':
            audit_2018 = item['number_value']
        elif item['category'] == 'Statutory Audit, Certification, Audit of Individual and Consolidated Financial Statements' and item['header2'] == '2019':
            audit_2019 = item['number_value']

    if audit_2018 is not None and audit_2019 is not None:
        increase = audit_2019 - audit_2018
        return (round(increase, 2), 'thousand')
    else:
        return (None, None)

