            fy18_value = item['number_value']
        elif item['category'] == 'Combustion of fuel and operation of facilities (Scope 1)' and item['header1'] == 'FY19**':
            fy19_value = item['number_value']

    if fy18_value is not None and fy19_value is not None:
        change = fy19_value - fy18_value
        scale = 'thousand'  # Assuming scale is not provided, defaulting to thousand
