def run(value_list):
    """
    Calculates the nominal difference for ROFE between F19 and F18.

    Args:
        value_list: A list of dictionaries containing financial data.

    Returns:
        A tuple (number, scale) representing the difference in ROFE between F19 and F18.
    """
    f19_rofe = None
    f18_rofe = None

    for item in value_list:
        if item['category'] == 'ROFE (%)' and item['header1'] == '53 WEEKS' and item['header2'] == 'F19':
            f19_rofe = item['number_value']
        if item['category'] == 'ROFE (%)' and item['header1'] == '52 WEEKS' and item['header2'] == 'F18 (3)':
            f18_rofe = item['number_value']

    if f19_rofe is not None and f18_rofe is not None:
        difference = abs(f19_rofe - f18_rofe)
        return (round(difference, 2), 'million')
    else:
        return (None, None)

