def run(value_list):
    """
    Calculates the percentage change in the Reductions related to a lapse of applicable statute of limitations between 2017 and 2018.

    Args:
        value_list: A list of dictionaries containing financial data.

    Returns:
        A tuple (number, scale).
    """
    red_2017 = None
    red_2018 = None

    for item in value_list:
        if item['category'] == 'Reductions related to a lapse of applicable statute of limitations':
            if item['header1'] == '2017':
                red_2017 = item['number_value']
            elif item['header1'] == '2018':
                red_2018 = item['number_value']

    if red_2017 is not None and red_2018 is not None:
        percentage_change = ((red_2018 - red_2017) / red_2017) * 100
        return (round(percentage_change, 2), '')
    else:
        return (None, '')

