    for item in value_list:
        if item['category'] == 'Outstanding, beginning of the year' and item['header1'] == '2018':
            beginning_of_year_2018 = item['number_value']
        if item['category'] == 'Outstanding, beginning of the year' and item['header1'] == '2019':
            beginning_of_year_2019 = item['number_value']

    increase_decrease = beginning_of_year_2019 - beginning_of_year_2018

    if increase_decrease == 0:
        return (0.00, '')
    elif increase_decrease > 0:
        return (round(increase_decrease, 2), 'thousand')
    else:
        return (round(increase_decrease, 2), 'thousand')

